import React from 'react';

import Header from '../Components/Header';

function Traktir(){

    return (
        <div>
        <Header/>

  <div className="headerAlsham">
          <div className="alsham_1"></div>
          <div className="alsham_2">
              <h1 className="alsham_2_title">Ресторан Аль-Шам</h1>
              <p className="alsham_2_p">Прекрасные славянские традиции 
              возрождает уютный ресторан под названием «Трактиръ». Здесь вам подадут изысканные 
              яства украинской кухни, и как водится, все кушанья готовят только из натуральных 
              продуктов и в соответствии 
              с вековыми традициями. Интерьер под стать тематике: деревянные столы, картины из народной жизни и многое другое создают по-истине славянскую атмосферу.</p>
          </div>
          </div>
      </div>
    );
}

export default Traktir;
